class Contact extends Component {
	render() {
		return (
			<div id="contact" className="section-content section-dark">
				<h2>Where to find us ?</h2>
				<p>Parth Kansara: +91-9029480621</p>
				<p>Siddhi Mehta: +91-9029480621</p>
			</div>
		);
	}
}
export default Contact;
